import React, { Component } from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";
const App = ({ Component }) => {
  return <Component />;
};
Component.PropTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
